import TurtleBadge from "../images/rama.svg";
import FishBadge from "../images/fish-badge.svg";
import PenguinBadge from "../images/penguin-badge.svg";
import DolphinBadge from "../images/dolphin-badge.svg";

const badges = [
  {
    src: TurtleBadge,
    message: " puntos! Ganaste una insignia de rama!"
  },
  {
    src: PenguinBadge,
    message: " puntos! Ganaste una insignia de penguin!"
  },
  {
    src: FishBadge,
    message: " puntos! Ganaste una insignia de fish!"
  },
  {
    src: DolphinBadge,
    message: " puntos! Ganaste una insignia de dolphin!"
  },
  {
    src: TurtleBadge,
    message: " punto! Ganaste una insignia de turtle!"
  }
];

export default badges;
